import React from 'react';
//import { MuiButton } from './components/MuiButton'
import { Button } from '@material-ui/core';
import { Stack } from '@mui/material';


const Play = ()=> {
  return (
    <div className='play-page'>
      <h1>Play Page</h1>
      {/* <MuiTypography /> */}
      {/*<MuiButton /> */}
      <Stack spacing={4}>
      <Stack spacing={2} direction='row'>
      <Button variant ='text'>Text</Button>
      <Button variant ='contained'>Contained</Button>
      </Stack>
      <Stack spacing={2} direction='row'>
      <Button variant ='contained' color="primary">Error</Button>
      <Button variant ='contained' color="default">Error</Button>
      <Button variant ='contained' color="secondary">Error</Button>
      </Stack>
      </Stack>
    </div>
  );
}

export default Play;
